import { faBars, faClose, faPencil, faTimes } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { React, useState } from "react";
import { Link } from "react-router-dom";
import logo from "../../utils/logo.png";
import "./Profile.css";

const profileTab = [
  { id: 0, label: "Profile" },
  { id: 1, label: "Completed Courses" },
];

const Profile = () => {
  const [userFirstName, setUserfirstName] = useState("Oluwaseyi");
  const [userLastName, setUserLastName] = useState("Ajewole");
  const [userEmail, setUseremail] = useState("Olubayoseyi10@gmail.com");
  const [userUniversity, setUseruniversity] = useState(
    "Bowen University, iwo, Osun state"
  );
  const [userPassword, setUserpassword] = useState("Oluwaseyi1234###");
  const [activeTab, setActiveTab] = useState(0);
  const [open,  setOpen] = useState(false)

  const inputchangehandler = (event) => {
    setUserfirstName(event.target.value);
  };
  return (
    <>
      <div className="nav">
        <div className="nav-container">
          <div className="nav-logo">
            <Link to="/">
              <img src={logo} alt="logo" />
            </Link>
          </div>
        </div>
      </div>
      <div className="profile-container">
        <div className="menu-icon">
            <FontAwesomeIcon icon={faBars} />
        </div>
        <div className="profile-id">
            <div className="cancel-icon">
                <FontAwesomeIcon icon={faClose} />
            </div>
          <div className="user">
            <span className="userprofile">AO</span>
            <p>Oluwaseyi</p>
          </div>

          <div className="objective">
            <div className="objective-container">
              <div className="Sidenav-tab">
                <div className="Menutabs">
                  {profileTab.map((menu) => (
                    <ul
                      className={activeTab === menu.id ? "active" : ""}
                      onClick={() => setActiveTab(menu.id)}
                    >
                      <li key={menu.id}>{menu.label}</li>
                    </ul>
                  ))}
                </div>
              </div>
            </div>
            <div className="logoutbtn">
                <Link to="/">
                  <button>Log Out</button>
                </Link>
              </div>
          </div>
        </div>
        <div className="profile-edit">
          {activeTab === 0 && (
            <form>
              <div className="fullname">
                <div className="name">
                  <label>Firstname</label>
                  <br />
                  <input
                    type="text"
                    placeholder="Firstname"
                    onChange={inputchangehandler}
                    value={userFirstName}
                  />
                  <FontAwesomeIcon icon={faPencil} />
                </div>
                <div className="name">
                  <label>Lastname</label>
                  <input
                    type="text"
                    placeholder="Lastname"
                    onChange={inputchangehandler}
                    value={userLastName}
                  />
                  <FontAwesomeIcon icon={faPencil} />
                </div>
              </div>
              <div className="inst">
                <label>Email</label>
                <input
                  type="email"
                  placeholder="Email"
                  onChange={inputchangehandler}
                  value={userEmail}
                />
                <FontAwesomeIcon icon={faPencil} />
              </div>
              <div className="inst">
                <label>Institution</label>
                <input
                  type="text"
                  placeholder="Institution"
                  onChange={inputchangehandler}
                  value={userUniversity}
                />
                <FontAwesomeIcon icon={faPencil} />
              </div>
              <div className="password">
                <label>Password</label>
                <div className="pass">
                  <input
                    type="password"
                    onChange={inputchangehandler}
                    value={userPassword}
                  />
                  <Link
                    to="/Change password"
                    style={{ textDecoration: "none" }}
                  >
                    <span>Change password</span>
                  </Link>
                </div>
              </div>
            </form>
          )}
          {activeTab === 1 && ""}
        </div>
      </div>
    </>
  );
};

export default Profile;
